import React from "react";
import CardStd from "../../component/card-std/cardStd.component";
import Navbar from "../../component/navbar/navbar.component";
import "./students.css";

const Students = () => {
  return (
    <div className="body">
      <Navbar />
      <div className="cards">
        <CardStd />
        <CardStd />
        <CardStd />
      </div>
    </div>
  );
};

export default Students;
